import {
  SET_AUTHENTICATION,
  SET_USERNAME,
  SET_TOKEN_REF,
} from "../storeconstants";

export default {
  [SET_AUTHENTICATION](state, authenticated) {
    state.authenticated = authenticated;
  },
  [SET_USERNAME](state, username) {
    state.username = username;
  },
  [SET_TOKEN_REF](state, tokenref) {
    state.tokenref = tokenref;
  },
};
